import React, { useState, useEffect } from "react";
import { Select, MenuItem, InputLabel, FormControl } from "@mui/material";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const FilterBy = (props) => {
  const navigate = useNavigate();

  // arrays from DB
  const [ sectors, setSectors ] = useState("")
  const [ productTypes, setProductTypes ] = useState("");
  const [ opportunityTypes, setOpportunityTypes ] = useState("");

  // selected form options
  const [selectedSector, setSelectedSector] = useState("");
  const [selectedProduct, setSelectedProduct] = useState("");
  const [selectedOppType, setSelectedOppType] = useState("");

  // event handlers
  const handleSectorChange = (event) => {
    setSelectedSector(event.target.value);
  };
  const handleProductChange = (event) => {
    setSelectedProduct(event.target.value);
  };
  const handleOppTypeChange = (event) => {
    setSelectedOppType(event.target.value);
  }

  //get sectors for dropdown
  useEffect(() => {
    axios
      .get(`http://localhost:5500/form-options/sectors`)
      .then((response) => {
        if (response.data.auth === false) {
          // if jwt has expired
          navigate("/expired");
        }
        setSectors(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, [navigate]);

  if (props.page === "project-connect") {

    //get opportunityType for dropdown
    axios
      .get(`http://localhost:5500/form-options/opportunity-types`)
      .then((response) => {
        if (response.data.auth === false) {
          // if jwt has expired
          navigate("/expired");
        }
        setOpportunityTypes(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  } else {

    //get productType for dropdown
    axios
      .get(`http://localhost:5500/form-options/product-types`)
      .then((response) => {
        if (response.data.auth === false) {
          // if jwt has expired
          navigate("/expired");
        }
        setProductTypes(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }

  // ternary operator returning different menu items depending on the page prop
  return (
    <div>
      <FormControl
        sx={{
          borderRadius: "15px",
          "& .MuiOutlinedInput-root": {
            borderRadius: "20px",
            "& fieldset": {
              borderColor: "transparent",
            },
            "&:hover fieldset": {
              borderColor: "transparent",
            },
            "&.Mui-focused fieldset": {
              borderColor: "transparent",
            },
          },
          backgroundColor: "white",
        }}
        required="required"
      >
        <InputLabel id="sector-label">Select Sector</InputLabel>
        <Select
          labelId="sector-label"
          id="sector-select"
          defaultValue=""
          style={{ width: 330 }}
          value={selectedSector}
          onChange={handleSectorChange}
        >
          {sectors.map((sectorObj, index) => (
            <MenuItem key={index} value={sectorObj.sector}>
              {sectorObj.sector}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      {props.page === "project-connect" ? (
        <FormControl
          sx={{
            left: 40,
            borderRadius: "15px",
            "& .MuiOutlinedInput-root": {
              borderRadius: "20px",
              "& fieldset": {
                borderColor: "transparent",
              },
              "&:hover fieldset": {
                borderColor: "transparent",
              },
              "&.Mui-focused fieldset": {
                borderColor: "transparent",
              },
            },
            backgroundColor: "white",
          }}
          required="required"
        >
          <InputLabel id="opp-type-label">Select Opportunity Type</InputLabel>
          <Select
            labelId="opp-type-label"
            id="opp-type-select"
            defaultValue=""
            style={{ width: 330 }}
            value={selectedOppType}
            onChange={handleOppTypeChange}
          >
            {opportunityTypes.map((opportunityTypeObj, index) => (
              <MenuItem key={index} value={opportunityTypeObj.opportunityType}>
                {opportunityTypeObj.opportunityType}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
      ) : (
        <FormControl
          sx={{
            left: 40,
            borderRadius: "15px",
            "& .MuiOutlinedInput-root": {
              borderRadius: "20px",
              "& fieldset": {
                borderColor: "transparent",
              },
              "&:hover fieldset": {
                borderColor: "transparent",
              },
              "&.Mui-focused fieldset": {
                borderColor: "transparent",
              },
            },
            backgroundColor: "white",
          }}
          required="required"
        >
          <InputLabel id="product-label">Select Product Type</InputLabel>
          <Select
            labelId="product-label"
            id="product-select"
            defaultValue=""
            style={{ width: 330 }}
            value={selectedProduct}
            onChange={handleProductChange}
          >
            {productTypes.map((productTypeObj, index) => (
              <MenuItem key={index} value={productTypeObj.productType}>
                {productTypeObj.productType}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
      )}
    </div>
  );
};

export default FilterBy;
